import React, { Component } from 'react'

import { Dropdown } from 'primereact/dropdown';

import './SaveOcrResultButton.css'



export default class SaveOcrResultButton extends Component {

    constructor(props) {
        super(props);

        this.items = [
            {
                label: 'Plain Text (txt)',
                icon: 'pi pi-refresh',
                type: 'text/plain',
            },
            {
                label: 'Portable Document (pdf)',
                icon: 'pi pi-times',
                command: () => {
                    this.toast.show({ severity: 'success', summary: 'Delete', detail: 'Data Deleted' });
                }
            },
            {
                label: 'Microsoft Word (docx)',
                icon: 'pi pi-refresh',
                command: () => {
                    this.toast.show({severity:'success', summary:'Updated', detail:'Data Updated'});
                }
            },
            {
                label: 'OpenOffice (odf)',
                icon: 'pi pi-refresh',
                command: () => {
                    this.toast.show({severity:'success', summary:'Updated', detail:'Data Updated'});
                }
            },
        ];

        // application/vnd.oasis.opendocument.text

    }


    render() {
        return (
            <div>
                <Dropdown value="lele" placeholder="Download" options={this.items} optionlabel="label" />
            </div>
        )
    }
}
